import React from 'react'
import ReactDOM from 'react-dom'
import { HashRouter, Route, Switch } from 'react-router-dom' // 引入路由
// import { Router , Redirect, Route , IndexRoute , browserHistory } from 'react-router';
// 引入redux
// import { Provider } from 'react-redux'
// import store from './redux/store'

import './index.css'
import LogIn from './components/logIn/logIn'
import TeacherHome from './components/teacherHome/teacherHome'
import StudentHome from './components/studentHome/studentHome'
import QuickLogIn from './components/quickLogIn/quickLogIn'
import ForgotLogIn from './components/forgotLogIn/forgotLogIn'
import StudentCenter from './components/studentCenter/studentCenter'
import SelectTopic from './components/selectTopic/selectTopic'
import GraduationProject from './components/graduationProject/graduationProject'
import FindRepeat from './components/findRepeat/findRepeat'

ReactDOM.render(
  <div>
    <HashRouter>
      <Switch>
        <Route path="/teacherHome" component={TeacherHome} /> {/*登陆页面 */}
        <Route path="/studentHome" component={StudentHome} /> {/* 学生界面 */}
        <Route path="/forgotLogIn" component={ForgotLogIn} /> {/*忘记密码页面*/}
        <Route path="/quickLogIn" component={QuickLogIn} /> {/*快速登陆页面*/}
        <Route path="/studentCenter" component={StudentCenter} /> {/*学生个人中心*/}
        <Route path="/selectTopic" component={SelectTopic} /> {/*我要选题*/}
        <Route path="/graduationProject" component={GraduationProject} /> {/*我的毕设*/}
        <Route path="/findRepeat" component={FindRepeat} /> {/*论文去重*/}
        <Route component={LogIn} /> {/* 默认组件：老师界面*/}
      </Switch>
    </HashRouter>
  </div>,
  document.getElementById('root'),
)
